import React, { Component, createContext } from 'react'
//import '../App.css'


class Carmodel extends React.Component {
    constructor(props) {
      super(props);
    
  
    }
  
   
  
    render() {
      return (
        <header>
        <div class="main">
            
              
                <a href="#"><img src={'images/carwalelogo.png'} width="30" height="30" /></a>
                <a href="#"><img src={'images/locationLogo.png'} width="30" height="30" /></a>
                
           
        </div>
    </header>
      );
    }
  }
  



export default Carmodel;
